-- Table structure for `school_schools`
-- ----------------------------
DROP TABLE IF EXISTS `school_schools`;
CREATE TABLE `school_schools` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `code` varchar(50) COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `province` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '省份',
  `province_code` int(10) unsigned DEFAULT NULL,
  `city` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '城市',
  `city_code` int(10) unsigned DEFAULT NULL,
  `district` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '地区',
  `district_code` int(10) unsigned DEFAULT NULL,
  `logo` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `createdate` year(4) DEFAULT NULL COMMENT '创办年份',
  `type_id` int(10) unsigned NOT NULL COMMENT '学校类型',
  `category_id` int(10) unsigned NOT NULL COMMENT '高校类别',
  `nature_id` int(10) unsigned NOT NULL COMMENT '高校性质',
  `department` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `http` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `click` int(10) unsigned NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `schools_code_unique` (`code`),
  KEY `schools_type_id_foreign` (`type_id`),
  KEY `schools_category_id_foreign` (`category_id`),
  KEY `schools_nature_id_foreign` (`nature_id`),
  CONSTRAINT `schools_category_id_foreign` FOREIGN KEY (`category_id`) REFERENCES `school_categories` (`id`),
  CONSTRAINT `schools_nature_id_foreign` FOREIGN KEY (`nature_id`) REFERENCES `school_natures` (`id`),
  CONSTRAINT `schools_type_id_foreign` FOREIGN KEY (`type_id`) REFERENCES `school_types` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

